INSERT INTO `comments` (`id`, `text`, `textru`, `texten`, `userid`, `allow`, `created_at`, `updated_at`) VALUES
(1, '   It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.', 'Всем здравствуйте! Меня зовут Лаура, я основатель онлайн-школы «Mama.inBusiness” (IG: @mama.inbusiness). С компанией ZOV EXPRESS и лично Орханом я знакома больше двух лет. С самых первых дней мы смогли установить прочные партнёрские отношения, которые динамично растут с каждым годом. Я благодарна Орхану за очень тёплое отношение ко всей моей команде и к нашим ученицам. Спасибо, что оперативно решаете все вопросы и даете лучшие тарифы и сроки на доставку. Всегда найдёте решение для каждого клиента. Впервые встречаю такой уровень клиентоориентированности и личной вовлечённости руководства. Также я благодарна за то, что вы всегда открываете все новые горизонты. У вас просто нет границ! И это очень круто! Мы всегда с большим удовольствием поддержим все ваши новые идеи. Успехов вам в этом потрясающем сервисе: соединять разные миры и дарить людям радость покупок и возможность вести бизнес.', '   It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.', '2', 1, NULL, NULL),
(2, 'efwegwe', 'Уже 2 года работаю с ЗОВ ! Довольна на все 100%. Спасибо большое всей вашей команде, всё на высшем уровне)', 'kuykyukyuk', '29', 1, NULL, NULL),
(3, '3eeeee', 'Получила свою посылку из Гуанчжоу всего за 3 дня, оперативно, уникальный сервис, молодцы !!! Спасибо вам', 'rrr', '30', 1, NULL, NULL),
(4, '', 'Ребята супер, доставили во время по отличной цене, спасибо ! Будем сотрудничать дальше\r\n', '', '31', 1, NULL, NULL),
(5, '', 'Спасибо ТАСКО что помогли выбрать и выкупить товар, а доставка на высшем уровне, так держать 👍', '', '32', 1, NULL, NULL),
(6, '', 'Зов можно вас похвалить за хорошую работу! У вас самый лучший сервис! С самого начала вашего открытия я работаю с вами, и за все время вы меня не подводили, попробовав многие компании я для себя сравнила что лучше вас нет никого, вы номер 1 в своём деле! Да и все ваши клиенты много раз убеждались что вы лучшие! У вас все на высшем уровне! Спасибо вам за хорошую обратную связь, за отзывчивость и за то что вы всегда идёте на встречу к своим клиентам! Желаю вам ещё больше успехов, ещё больше клиентов! 😘', '', '33', 1, NULL, NULL),
(7, '', 'ZovExpress и TASCO две прекрасные компании которые полностью дополняют друг друга, никогда не был настолько доволен выкупом и доставкой товара из Китая. Так держать ! ', '', '34', 1, NULL, NULL),
(8, '', 'Увидела в группе в Вичате обьявление про ZOVexpress и сразу написала. До ZOVexpress долго искала подходящую транспортную компанию для моих учеников, но каждый раз сталкивалось с неприятностями. Пришлось срочно искать им замену, в роли которой и выступила компания ZOVexpress.\r\nСдержали слово о сроках доставки, приятный и общительный персонал, цена полностью устроила меня и моих учеников. \r\nМои ученики остались довольными о сроках доставки и цене. Так что теперь я с полной уверенностью буду работать с этой компанией и желаю процветание. \r\n', '', '35', 0, NULL, NULL),
(9, '', 'ZovExpress sizə çox minnətdaram, bugün öz sifarişimi aldım, çinnən buqədər asanlıqla məhsul alıb, və buqədər tez çatdırılacagına inana bilməzdim) Sizinlə bu real oldu, servisdən tam razı qaldım!\r\n', '', '36', 1, NULL, NULL),
(10, '', 'Здравствуйте 😅 хочу оставить свой отзыв о транспортной компании Zov Express❤ Работаю с вами очень давно  и очень рада, что нашла вас😅 честно, до вас я работала с многими компаниями и сервис меня не всегда удовлетворял😒 а в вас я влюбилась со своего первого заказа😅👍🏼все четко,ясно и конкретно) а еще удобная локация в центре города😍✨ удобный сайт,соотношение качества и цены за доставку👍🏼 приятные бонусы клиентам и скидки🙈❤ советую вас всегда и всем😅 спасибо еще раз за вашу качественную работу 😊🤞', '', '321', 1, NULL, NULL);
