(22, NULL, '<p><br></p><p>Международная курьерская служба ZOV GROUP выполняет посреднические курьерские услуги между иностранным продавцом, перевозчиком и заказчиком.</p><p><br></p><p>При регистрации на сайте www.zovexpress.com заказчик с полной ответственностью принимает следующие условия связанные с услугами компании ZOV GROUP:</p><p><br></p><p><br></p><p>&nbsp;1. При не правильном указании адреса со стороны продавца компания не несёт ответственности за посылку.</p><p>&nbsp;2. При доставке посылки на не правильный адрес со стороны иностранной курьерской службы компания не несёт ответственности за посылку.</p><p>&nbsp;3. Компания несёт ответственность за целостность посылки после поступления на склад компании.</p><p>&nbsp;4. Компания не несёт ответственности за поломку хрупких товаров (заказчик может заранее заказать деревянную обрешётку в избежании поломок)</p><p>&nbsp;5. При потере товара отводится до 14 рабочих дней для выяснении обстоятельств.&nbsp;</p><p>&nbsp;6. При отсутствии результата относительно потерянного товара в течении 14-и дней, на 15-ый день заказчику выплачивается стоимость потерянного товара при наличии чека или накладного выкупленного товара.</p><p>&nbsp;7. При опоздании груза больше установленного срока (+2 дня) делается скидка на каждый опоздавший день.</p><p>&nbsp;8. Скидки не действуют на период закрытия границ, праздников и чрезвычайных предшествий связанных с природными условиями.</p><p>&nbsp;9. Скидки не действуют при предупреждении заранее со стороны компании об ожидаемых опозданиях.</p><p>&nbsp;10. При опоздании груза больше чем на 60 дней, при отсутствии чрезвычайных происшествий, компания ZOV GROUP обязуется вести диалог с транспортной компанией о выплате денежных средств заказчикам.</p><p>&nbsp;11. При чрезвычайных случаях, связанных с непредвиденным закрытием границы, закрытием городов или провинций через которые проходят грузы, случаев связанных с пандемией, войной, случаев закрытия таможни, образования больших очередей на границе, при любых непредвиденных чрезвычайных случаях, решение которого не зависит от транспортной компании и от посреднической курьерской службы ZOV GROUP, никакой ответственности за сроки компания не несёт. При этом компания несёт ответственность за сохранность товара до решения той или иной проблемы со стороны соответствующих органов, до сдачи товара заказчику.&nbsp;</p><p>&nbsp;12. При заказе товаров со стороны заказчика с иностранных интернет порталов компания не несёт ответственности за качество товара.</p><p>&nbsp;13. Не использованные бонусы накопленные в бонусной карте клиента обнуляются каждые 3 месяца.</p><p>&nbsp;14. При указанном не правильном весе товара компания обязуется сделать перерасчёт.</p><p>&nbsp;15. Все посылки поступившие на иностранные склады компании полностью страхуются.</p>', 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.', 'İSTİFADƏÇİ RAZILAŞMASI', 'ПОЛЬЗОВАТЕЛЬСКОЕ СОГЛАШЕНИЕ', 'USER AGREEMENT', 5, 3, NULL, NULL, '2020-11-18 00:28:17'),
